-- Competencias

VALUES (1,'Adaptación a las Nuevas Tecnologías','Es la capacidad de adaptación a la evolución tecnológica del entorno donde se desenvuelve aprovechando en el desarrollo de sus funciones los recursos y medios que pone a su disposición la tecnología, tanto de la mano de la empresa como estando disponibles en su entorno.',3,'UCMP-0010');
VALUES (2,'Anticipación y Proactividad','Es la capacidad de identificar un problema, obstáculo u oportunidad y llevar a cabo acciones para dar respuesta a ellos.',6,'UCMP-0028');
VALUES (3,'Autoconfianza','Es el convencimiento de que uno es capaz de realizar con éxito una tarea o elegir el enfoque adecuado para realizar un trabajo o resolver un problema.',4,'UCMP-0018');
VALUES (4,'Autocontrol','Es la capacidad de mantener el control y la calma ante situaciones hostiles, de rechazo o estresantes. Asimismo, implica el resistir positivamente en condiciones constantes de estrés.',4,'UCMP-0017');
VALUES (5,'Autodesarrollo','Es la competencia relacionada con el crecimiento personal y profesional, el fortalecimiento de sus capacidades, comparando lo que uno hace con lo que sería capaz de hacer, en el proceso de búsqueda de la excelencia.',8,'UCMP-0035');
VALUES (6,'Búsqueda de Información','Es la inquietud y la curiosidad constante por saber más sobre cosas, hechos o personas. Implica buscar información más allá de las preguntas rutinarias o de los que se requiere en el puesto. ',7,'UCMP-0032');
VALUES (7,'Capacidad de Organización','Se refiere a la habilidad de ordenar y distribuir el trabajo, la autoridad y los recursos de un negocio, para alcanzar los objetivos propuestos.',8,'UCMP-0037');
VALUES (8,'Comprensión de la Organización','Es la capacidad para comprender e interpretar las relaciones de poder en la propia empresa o en otras organizaciones (clientes, proveedores, etc.). ',5,'UCMP-0024');
VALUES (9,'Comprensión interpersonal y Empatía','Es la habilidad para escuchar y entender correctamente los pensamientos, sentimientos o preocupaciones del otro aunque no se expresen verbal o totalmente.',5,'UCMP-0022');
VALUES (10,'Comunicación Efectiva','Es la capacidad de transmitir ideas claramente, teniendo en cuenta a los diferentes destinatarios de un mensaje, tanto de forma oral como escrita, aprovechando los recursos disponibles para ello, ya sean técnicos o no, garantizando el impacto de la información transferida como su comprensión.',8,'UCMP-0036');
VALUES (11,'Confianza para el desempeño','',1,'UCMP-0001');
VALUES (12,'Conocimiento del Entorno','Es la habilidad para incluir en la toma de decisiones, aquellas variables que afectan directa e indirectamente el normal desempeño de la organización que permitan una ventaja competitiva de la misma en el sector siendo congruentes con la misión, visión y el proyecto de empresa.',3,'UCMP-0009');
VALUES (13,'Delegación','Delegar implica distribuir el trabajo teniendo en cuenta las características de los responsables y las tareas o responsabilidades a cubrir.',2,'UCMP-0003');
VALUES (14,'Desarrollo de Personas','Implica un esfuerzo constante por mejorar el aprendizaje o el desarrollo de los demás a partir de un apropiado análisis de sus necesidades y de la organización. ',2,'UCMP-0004');
VALUES (15,'Desarrollo de relaciones','Consiste en actuar para establecer y mantener relaciones cordiales, recíprocas y cálidas o redes de contacto con distintas personas.',5,'UCMP-0025');
VALUES (16,'Dirección de personas','Implica la intención de hacer que otras personas actúen según nuestros deseos utilizando apropiada y adecuadamente el poder personal o la autoridad que el puesto nos confiere.',2,'UCMP-0005');
VALUES (17,'Disponibilidad para viajar / Geográfica','Es la disponibilidad para invertir tiempo adicional en desplazamientos y estancias necesarios para el correcto desarrollo de las funciones del puesto en beneficio del cumplimiento de los objetivos de la organización.',8,'UCMP-0038');
VALUES (18,'Escuchar y Responder','Se refiere a cómo las personas utilizan su comprensión de los demás. Implica adaptar la respuesta en función de los sentimientos, preocupaciones o pensamientos de otros.',2,'UCMP-0006');
VALUES (19,'Flexibilidad','Es la habilidad de adaptarse y trabajar eficazmente en distintas situaciones y con personas o grupos diversos.',4,'UCMP-0014');
VALUES (20,'Gestión del Cambio','Es la habilidad de identificar y transmitir al grupo la necesidad de cambios específicos en la manera de hacer las cosas, y promoverlos.',5,'UCMP-0020');
VALUES (21,'Gestión del Tiempo','Es la capacidad para establecer con criterio, prioridades a la hora de ejecutar esquemas, basándose en la visión proyectada para planificar estrategias que minimicen el tiempo de la actividad y optimicen el desarrollo de las tareas.',8,'UCMP-0039');
VALUES (22,'Identificación con la Compañía','Es la capacidad y voluntad de orientar los propios intereses y comportamientos hacia las necesidades, prioridades y objetivos de la compañía. ',4,'UCMP-0015');
VALUES (23,'Impacto e influencia','Implica la intención y capacidad de persuadir, convencer, influir o impresionar  a los demás para que contribuyan a alcanzar los objetivos propios.',5,'UCMP-0021');
VALUES (24,'Iniciativa','Es hacer más de lo que se requiere o espera en el puesto para mejorar o incrementar los resultados, evitar problemas o encontrar nuevas oportunidades. ',6,'UCMP-0027');
VALUES (25,'Innovación','Es la Capacidad para concebir y realizar tareas nuevas e inexistentes con el propósito de diseñar y generar nuevos procesos con mayores niveles de rentabilidad, eficiencia y tecnología punta.',7,'UCMP-0031');
VALUES (26,'Integridad','Es la capacidad de actuar en consonancia con lo que cada uno considera importante. Incluye el comunicar las intenciones, ideas y sentimientos abierta y directamente, y el estar dispuesto a actuar honestamente incluso en negociaciones difíciles con agentes externos.',4,'UCMP-0016');
VALUES (27,'Liderazgo','Asume el rol de líder combinando los dos tipos de comportamiento que ejerce un líder para adaptarse al nivel de desarrollo de su equipo de trabajo (Comportamiento directivo: Define las funciones y tareas de los subordinados, señala qué, cómo y cuándo deben realizarlas y controla los resultados; por un lado y por otro el  Comportamiento de apoyo: Centrado en el desarrollo del grupo, fomenta la participación en la toma de decisiones, y da cohesión, apoya y motiva al grupo) .',2,'UCMP-0007');
VALUES (28,'Mediación y manejo de conflictos','Es la competencia para plantear soluciones y resolver diferencias de ideas u opiniones de las partes, apoyándose en la suficiente autoridad y justicia, centrándose en los intereses comunes, tratando de conciliar y mediar de manera equitativa para las partes, evitando la manipulación y la parcialidad de los intereses personales.',5,'UCMP-0023');
VALUES (29,'Motivación para el desempeño','',1,'UCMP-0002');
VALUES (30,'Orientación a Resultados','Es la preocupación por realizar bien el trabajo o sobrepasar un estándar.',6,'UCMP-0026');
VALUES (31,'Orientación al Cambio','Se refiere a la permeabilidad a los cambios. Incluye la innovación y la consideración del riesgo.',8,'UCMP-0040');
VALUES (32,'Orientación al cliente','Implica un deseo de ayudar o servir a los clientes, de satisfacer sus necesidades. Significa centrarse en descubrir o satisfacer las necesidades de los clientes.',5,'UCMP-0019');
VALUES (33,'Pensamiento Analítico','Es la capacidad de entender una situación, desagregándola en pequeñas partes o identificando sus implicaciones paso a paso.',7,'UCMP-0029');
VALUES (34,'Pensamiento Conceptual','Es la habilidad para identificar en las situaciones pautas o relaciones que no son obvias  o  identificar puntos clave en situaciones complejas.',7,'UCMP-0030');
VALUES (35,'Pensamiento Estratégico','Habilidad para visualizar el escenario futuro donde se pretende llegar, es la capacidad de determinar la posición competitiva de la empresa mediante un análisis profundo de todos los factores internos y externos, y establecer estrategias integrales que vinculen toda la organización, identificando estrategias, previendo consecuencias y anticipándose a los hechos que pueden generar riesgos en las acciones empresariales que se implementen.',3,'UCMP-0012');
VALUES (36,'Pensamiento Ético','Es la capacidad para valorar los eventos internos y externos de la empresa basándose en criterios éticos personales y corporativos. ',7,'UCMP-0033');
VALUES (37,'Preocupación por el Medioambiente','La capacidad para respetar las reglas y normas correspondientes, asume la necesidad, y actúa en consecuencia, de alertar ante incumplimientos y peligros, aporta propuestas para la mejora de la protección del medio ambiente y sus implicaciones en las condiciones de trabajo.',3,'UCMP-0013');
VALUES (38,'Preocupación por el Orden y la Calidad','Se refleja en la continua comprobación y control del trabajo y la información, y en la insistencia en que las responsabilidades y funciones asignadas estén claras.',8,'UCMP-0041');
VALUES (39,'Preocupación por la Calidad y la Mejora continua','Es la capacidad de poner en marcha o mantener una forma de hacer las cosas en las que, fundamentalmente, predominan la preocupación por satisfacer al cliente y por mejorar, día a día, procesos y resultados. Potenciando la preocupación por instaurar una forma de gestión basada en la mejora continua en la organización.',3,'UCMP-0011');
VALUES (40,'Resolución de Problemas y Toma de Decisiones','Es la habilidad que comprende la capacidad de analizar una o varias situaciones, identificar las causas, generar posibles soluciones y planificarlas, identificando la solución más eficiente a un problema y optimizando los recursos disponibles.',7,'UCMP-0034');
VALUES (41,'Trabajo en Equipo','Trabajo en Equipo y Cooperación implica la intención de colaboración y cooperación con otros, formar parte de un grupo, trabajar juntos, como opuesto a hacerlo individual o competitivamente. Para que esta competencia sea efectiva, la intención debe ser genuina.',2,'UCMP-0008');

-- Competencias Niveles


VALUES (1,2,'Aprovecha poco las herramientas tecnológicas que tiene disponible, y dedica poco tiempo a corregirlo.');
