VALUES (40,10,'Realiza un control y análisis sobre la decisión adoptada y su implantación.');
VALUES (40,11,'Diseña planes de contingencia así como las acciones correctivas necesarias, hace que se desarrollen y lleva su control y seguimiento.');
VALUES (41,2,'Participa aportando lo que se le pide, acepta decisiones y realiza el trabajo que le corresponde.');
