VALUES (7,'Administrativo de Caja',3,'Efectuar pagos en efectivo o cheques contra órdenes escritas, documentos de crédito u operaciones de cambio, y hacer firmar los comprobantes pertinentes. Llevar registros de todas las operaciones tramitadas y comprobar si el balance de caja coincide con los comprobantes respectivos. Recibir dinero en metálico o cheques de los clientes. Efectuar pagos a los clientes. Pagar facturas y efectuar transferencias monetarias en nombre de los clientes. Acreditar y descontar fondos en las cuentas de los clientes. Realizar operaciones de cambio de moneda. ',NULL,16,'192','PT00195');
