VALUES (11,'Ajustador/a',3,'Leer e interpretar planos y croquis de mecanismos o máquinas y de sus elementos o piezas; conforme a ellos, trazar, marcar y acabar la superficie de estos elementos, de tal forma que permita el asiento o ajuste entre ellas con juegos o huelgas variables, según las circunstancias, de utilizar para ello otras herramientas o útiles y efectos que el cincel o buril, las diversas variedades de limas y el polvo esmeril, y montar máquinas y mecanismos, asegurando la nivelación, huelgos y equilibrado de las piezas, si así lo requieren.',131,9,'73','PT00076');
VALUES (12,'Albañil',3,'Leer planos o croquis de obras o de fábrica y replantearlos sobre terreno. Construir con ladrillo muros, paredes o tabiques utilizando cargas de mortero admisibles, debidamente aplomados y sin pandeos. Construir arcos, bóvedas o bovedillas de distintas clases, también con las menores cargas de mortero posible y, cuando fuera menester, con labrado de los ladrillos para su perfecto asiento a hueso; maestrar, revocar, blanquear, lucir, enlatar, correr molduras y hacer tirolesas y demás decoraciones corrientes y revestir pisos y paredes con baldosas o azulejos y tuberías o piezas de máquinas con productos de amianto y similares.',78,9,'74','PT00077');
VALUES (13,'Albañil',3,'Replantear y construir cimentaciones sencillas y redes horizontales de saneamiento. Levantar obra de fábrica con ladrillos, piedras y bloques de cemento. Construir cubiertas cerámicas y revestirlas con tejas. Ejecutar revestimientos continuos con morteros y pastas. ',78,10,'116',NULL);
