VALUES (17,'Analista',4,'Siguiendo las directrices del responsable del proyecto, determinar con el cliente el desarrollo de la aplicación informática. Proporcionar soporte técnico a los usuarios en la implantación de nuevas aplicaciones informáticas. Resolver las posibles incidencias que se puedan producir durante las pruebas y ejecuciones iniciales de las nuevas aplicaciones desarrolladas. Coordinar el equipo de programadores a su cargo.',NULL,17,'202','PT00205');
VALUES (18,'Analista - Programador/a',4,'Diseño y desarrollo de aplicaciones informáticas. Control de los costes del proyecto. Atención a cliente y usuarios durante las fases de desarrollo y puesta en marcha del proyecto. Resolución de las incidencias que se presenten. Elaboración de la documentación del usuario.',NULL,17,'203','PT00206');
VALUES (19,'Aparejador/a',4,'Planificación de los trabajos con seguimiento de las fases de ejecución y resolución de los problemas de tipo técnico que se planteen. Obtención de licencias y autorizaciones. Redacción de proyectos, informes y valoraciones. Control de calidad de los materiales, medidas de seguridad e higiene, interpretación y modificaciones del proyecto, certificaciones de obra, informes de avances e incidencias, comprobación de facturas de obras en base al proyecto. Realizar replanteos y comprobaciones. Valoración de terrenos. Planificar, bajo la supervisión del Arquitecto, la elaboración de los proyectos de obra a ejecutar, la realización de los servicios a desarrollar y la relación de suministros a adquirir. Colaborar en temas relacionados con planos, delimitación de suelos, etc., suministrando la información precisa, sobre todo, en materia de variaciones en la clasificación y calificación del suelo.',NULL,10,'117','PT00120');
VALUES (20,'Arquitecto',4,'Verificar la recepción en la obra de los productos de construcción, ordenando la realización de ensayos y pruebas. Dirigir la ejecución material de la obra comprobando los replanteos, los materiales y la correcta ejecución y disposición de los elementos constructivos y de instalaciones, de acuerdo con el proyecto y con las instrucciones. Consignar las instrucciones precisas. Suscribir el acta de replanteo o de comienzo de obra y el certificado final de obra. Elaborar y suscribir las certificaciones parciales y la liquidación final de las unidades de obra ejecutadas. Recibir los resultados de los ensayos o pruebas de servicio de materiales, sistemas o instalaciones, que le han de ser entregados, obligatoriamente, por las entidades y laboratorios de control de calidad de la edificación que, además, han de prestarle asistencia técnica. Colaborar en la elaboración de la documentación de la obra ejecutada y aportar los resultados del control realizado.',NULL,10,'118','PT00121');
VALUES (21,'Aserrador',3,'Recepcionar, clasificar y preparar la madera en rollo. Aserrar la madera en rollo. Reaserrar y clasificar la madera aserrada. Tratar la madera contra el azulado. ',NULL,9,'76','PT00079');
VALUES (22,'ATS',4,'Adminitrar medicación y tratamientos bajo supevisión médica. Realizar revisiones e informes. Participar en las comisiones de salud laboral.',NULL,2,'7','PT00008');
VALUES (23,'ATS-DUE',4,'Preparar y administrar los medicamentos según prescripciones facultativas, específicamente los tratamientos. Tomar la presión sanguínea, el pulso y la temperatura. Preparar el material y medicamentos que hayan de ser utilizados. Ordenar las historias clínicas, anotar los datos relacionados con la propia función que deba figurar. Atender al residente encamado por enfermedad, efectuando los cambios posturales prescritos, controlando el servicio de comidas a los enfermos y suministrando directamente a aquellos pacientes que dicha alimentación requiera instrumentalización (sonda nasogástrica, sonda gástrica, etc.). Controlar la higiene personal de los residentes y también los medicamentos y alimentos que estos tengan en las habitaciones. Atender las necesidades sanitarias que tenga el personal que trabaja en el centro y sean de su competencia. Colaborar con los/as fisioterapeutas en las actividades, el nivel de calificación de las cuales sean compatibles con su titulación de ATS/DUE, cuando sus funciones específicas lo permitan. Realizar los pedidos de farmacia, analítica y radiología en aquellos centros donde no exista especialista. Vigilar la ejecución de las actividades de tipo físico recibida por el médico, observando las incidencias que puedan presentarse durante su realización. ',NULL,15,'181','PT00184');
