VALUES (25,'Auxiliar de Cocina',3,'Realizar las labores de limpieza de maquinaria, fogones y demás elementos de cocina. Preparar e higienizar los alimentos. Transportar pedidos y otros materiales de su área. Realizar trabajos auxiliares para la elaboración de productos. Encargarse de las labores de limpieza del menaje, comedor y la cocina.',137,13,'151','PT00154');
VALUES (26,'Auxiliar de Laboratorio',3,'Realización de ensayos bajo la supervisión de sus superiores. Gestión administrativa de la documentación. ',NULL,7,'49','PT00052');
