VALUES (28,'Auxiliar de Recepción',5,'Realizar el control, almacenaje y transporte de los equipos de los clientes en las dependencias del hotel o a las puertas de acceso a éste. Encargarse de la ejecución de gestiones y encargos sencillos, tanto en el interior como en el exterior del establecimiento. Colaborar en el mantenimiento del orden y de la limpieza en las zonas de recepción y conserjería. Vigilar las instalaciones y comunicar las incidencias al departamento correspondiente. Controlar la entrada y salida de objetos, mercancías, proveedores y personal. Encargarse de conducir y estacionar los vehículos de los clientes, a petición de éstos, así como su vigilancia y custodia.',NULL,13,'153','PT00156');
VALUES (29,'Ayudante de Cocina',3,'Realizar preparaciones básicas, así como cualquier otra relacionada con las elaboraciones culinarias que le sean encomendadas. Preparar platos para los que haya recibido oportuno adiestramiento. Realizar las funciones del servicio en cocina bajo la supervisión y directrices emanadas directamente del mismo o persona en quien éste delegue. Realizar las tareas derivadas del perfil de la ocupación.',NULL,13,'154','PT00157');
VALUES (30,'Ayudante topográfico',4,'Realizar, con mayor o menor autonomía, levantamientos topográficos y replanteos. Realizar labores básicas y/o auxiliares en los levantamientos topográficos siguiendo las instrucciones que le imparte personal de mayor nivel.',NULL,10,'119','PT00122');
VALUES (31,'Barman',5,'Preparar todo tipo de bebidas. Recibir, despedir, ubicar y aconsejar a los clientes. Preparar diferentes tipos de cócteles y bebidas combinadas. Tomar los pedidos, distribuir y servir las bebidas con sus acompañamientos. Examinar y controlar las existencias de mercancías.',146,13,'155','PT00158');
VALUES (32,'Cajero/a',3,'Recibir dinero de los clientes en pago de mercancías o servicios adquiridos o efectuar pagos en efectivo. Cobrar y verificar los pagos efectuados en efectivo, por cheque o tarjeta de crédito. Operar una caja registradora. Devolver cambio y entregar recibos. Expedir billetes en oficinas de venta de billetes y cobrar los importes correspondientes. Recibir los pagos en efectivo que ingresan en un establecimiento, cotejar su importe con las facturas de las ventas efectuadas u otros documentos, y prepararlos para depósito bancario. Efectuar el pago de los sueldos o salarios del personal de un establecimiento.',NULL,12,'140','PT00143');
VALUES (33,'Calderero/a',3,'Leer e interpretar planos con croquis de carpintería o estructura metálica o de calderería y, conforme a ellos, realizar las labores de trazar, plantillar, enderezar, marcar, cortar, cepillar, punzonar, taladrar, curvar, armar, escariar, remachar, uñetear, cincelar, retacar y montar los elementos que la integran. Calentar y cortar con soplete y modelar las chapas o perfiles en caliente, mediante martillo. Leer e interpretar planos y croquis de construcción en cobre, latón y otros metales y, conforme a ellos, realizar las labores de batir, estirar, soldar, trazar, plantillear, enderezar, cortar, taladrar, curvar, armar, remachar y montar los elementos que las integran. Plantillear, cortar, roscar, curvar, ajustar, soltar bridas, encuadrar, calentar con soplete, montar y probar tuberías de cobre, latón y hierro, todo ello sin deformaciones, con arreglo a las formas y radios indicados en los planos.',129,9,'77','PT00080');
VALUES (34,'Camarero/a',5,'Preparar las áreas de trabajo para el servicio. Realizar la atención directa al cliente para el consumo de bebidas o comidas. Elaborar para consumo viandas sencillas. Transportar útiles y enseres necesarios para el servicio. Controlar y revisar mercancías y objetos de uso de la sección. Colaborar en el montaje, servicio y desmontaje de buffets. Realizar trabajos a la vista del cliente tales como flamear, cortar, trinchar, desespinar, etc. Colaborar con el jefe de comedor en la preparación y desarrollo de acontecimientos especiales. Informar y aconsejar al cliente sobre la composición y confección de los distintos productos a su disposición. Atender reclamaciones de clientes. ',138,13,'156','PT00159');
VALUES (35,'Camarero/a de Pisos',5,'Limpiar y ordenar las habitaciones, baños y pasillos entre las habitaciones de clientes. Controlar el material, productos de los clientes y comunicar a sus responsables las anomalías en las instalaciones y los objetos perdidos. Realizar la atención directa al cliente en las funciones propias de su área. Realizar las labores propias de lencería y lavandería.',142,13,'157','PT00160');
VALUES (36,'Cantero/a',3,'Labrar piedras de sillería de paramentos lisos y rectos. Labrar piedras de sillería de paramentos curvos lisos y paramentos con molduras. Asentar piedras de sillería y losas de pavimento. Retundir, limpiar y reparar obras de piedra de sillería.',NULL,10,'120','PT00123');
