VALUES (94,'Gobernante/a',5,'Supervisar la actividad de los trabajadores a su cargo, distribuir las actividades y turnos de las personas que tiene asignadas y vigilar también el buen uso y economía de los materiales, utillaje y herramientas y maquinaria a su cargo; proceder al recuento e inventario de éstos. En coordinación con el departamento de cocina, se responsabilizará de la buena marcha del servicio de comedor, distribución de comidas, control de regímenes, servicios especiales, montaje, limpieza y retirada del servicio. Tener conocimiento del número de servicios diarios realizados en el departamento. En coordinación con el personal de enfermería, llevar el control del buen estado de los alimentos que los residentes tengan en las habitaciones. En los centros, cuyas comidas se realicen mediante conciertos con terceros, colaborar en la confección de los menús, supervisar las condiciones sanitarias de las dependencias y alimentos servidos. Supervisar, cuando haya contrato de limpieza, el buen funcionamiento de los servicios contratados.Colaborar en las actividades propias del personal a sus órdenes. ',152,15,'185','PT00188');
VALUES (95,'Grabador/a',3,'Introducir datos en el sistema siguiendo las directrices de sus superiores. Prestar apoyo administrativo al departamento.',NULL,4,'26','PT00029');
VALUES (96,'Herrero/a-Forjador/a',3,'Leer e interpretar planos y croquis de piezas o elementos de hierro o acero forjado y, conforme a ellos, apreciar y calcular la mejor forma y dimensiones de semiproductos redondos, llantas o llantón, palanquillas, techo, etcétera, para obtener la pieza forjada con el máximo aprovechamiento de material. Estirar, aplanar, recalar, punzonar, bigormear, curvar, degollar, cortar, soldar, estampar y embutir estos materiales, según los casos, mediante percusión o comprensión en caliente, con el mínimo de caldas posibles.',NULL,9,'92','PT00095');
VALUES (97,'Hornero/a',3,'Cargar y descargar el horno, realizar las regulaciones eléctricas, cuidar de la refrigeración, realizar la colada, realizar la escorificación e interpretar las muestras de calidad. Vigilar la formación de granalla. Interpretar la marcha del convertidor por el tipo de probeta de ensayo, regular el funcionamiento del convertidor y limpieza y regulación de las toberas del horno. Ordenar cuantas maniobras del picado, cierre y estado de los canales y tobera precisa el proceso del trabajo específico del horno. Conocer a simple vista la calidad y grado de fluidez de hierro y escoria. Sacar las pruebas. Manejar los mandos de regulación eléctrica, de regulación hidráulica y de refrigeración. Cambios de bóveda y de electrodos. Regular el viento según la cadencia de fusión, interpretar la marcha del cubilete según el color y forma de las gotas de fusión, controlar la altura del caldo. Vigilar el proceso de fundido regulando la llama. A la vista de la muestra de fundido, calcular el tiempo que necesita introducir el inyector de aire para la total eliminación de impurezas, dando el grado de calentamiento necesario para preparar la operación de afino.',124,9,'93','PT00096');
VALUES (98,'Ingeniero/a de Proyectos',4,'Diseñar nuevos productos, equipos o instalaciones. Realización de estudios técnicos. Emisión de informes de seguimiento. Elaboración de memorias. Confección de indicadores.',NULL,7,'53','PT00056');
