VALUES (105,'Jefe/a de Departamento',2,'Dirigir y coordinar las actividades derivadas de las funciones asignadas al Departamento. Organizar, convocar y presidir las diferentes reuniones que celebre el Departamento. Responsabilizarse y participar en las tareas que se derivan de la elaboración de los Proyectos Curriculares, en la aportación que el Departamento debe efectuar para elaborar el Proyecto Educativo y la Programación General Anual, así como redactar la Programación Didáctica de las áreas, materias o módulos que se integran en el Departamento, la Memoria final de curso y la elaboración de las adaptaciones curriculares que, en su caso, se determinen. Coordinar y velar por el cumplimiento de la Programación Didáctica del Departamento y la aplicación correcta de los criterios de evaluación.  Informar al alumnado acerca de la Programación Didáctica de las áreas, materias y módulos del Departamento, con especial referencia a los objetivos, los mínimos exigibles y los criterios de evaluación. Organizar, preparar y supervisar, en coordinación con la Jefatura de Estudios, las pruebas para los alumnos de Bachillerato o Ciclos Formativos con materias o módulos pendientes, así como las pruebas de los alumnos libres o las pruebas extraordinarias que hubiere. Presidir la realización de los ejercicios correspondientes, y evaluarlos en colaboración con los miembros del Departamento. Coordinar la atención a los alumnos de Educación Secundaria Obligatoria que tengan áreas y materias no superadas correspondientes al Departamento. Garantizar el cumplimiento del procedimiento de reclamaciones en el proceso de evaluación del alumnado, de acuerdo con la normativa vigente. Custodiar las pruebas y documentos que hayan servido para valorar al alumnado. Coordinar la organización de espacios e instalaciones, proponer la adquisición del material y del equipamiento específico asignado al Departamento y velar por su mantenimiento. Gestionar la asignación económica establecida para su Departamento.',NULL,14,'176','PT00179');
