VALUES (119,'Modelista',3,'Leer e interpretar planos y croquis de piezas o elementos con madera, e indeformables hasta donde sea preciso, reproducciones positivas exteriores e interiores de estas piezas o elementos, o sea, modelos y cajas de machos o plantillas de contorno o terrajas destinadas a la elaboración de producciones negativas o moldes y machos, dándoles las dimensiones exigidas por las contradicciones que puedan preverse, según la clase de metal que se haya de fundir. Estimar los sobreespesores de material prevenible, para satisfacer las exigencias de los croquis o planos sobre el acabado o máquinas de dichas piezas o elementos. Conocer, en general, la mejor disposición que ha de darse a los moldes y cajas de machos, de forma que permita, si fuera necesario, su descomposición en trozos o partes, para hacer posible la salida de los primeros y la retirada de los segundos y determinar la posición o emplazamiento de las portadas o apoyos de macho y mejores dimensiones de éstos.',NULL,9,'96','PT00099');
VALUES (120,'Moldeador/a y Machero/a',3,'Leer e interpretar planos y croquis de piezas o elementos de máquinas o mecanismos y ejecutar, con mezcla de arena o barro, moldes o machos de dichos metales o piezas destinadas a conformar el caldo o metal en fusión de clase exigida para ello. Prever las superficies de separación de trozos en los moldes o machos, y los mejores emplazamientos, forma y dimensiones de los benedores, enfriadores y respiros, medios de contención y mazoratas de que deberá dotarse a los mismos, según los casos. Preparar las mezclas de arenas y determinar los tipos y dimensiones más apropiados de cajas. Disponer de armado y dar grados de atacado y ventado, enlucido y estufado de los moldes y machos más convenientes y dirigir su colada, así como ejecutar su desmoldeo.',125,9,'97','PT00100');
