VALUES (122,'Oficial de Mantenimiento',3,'Controlar las visitas y el trabajo realizado por las firmas contratadas para el mantenimiento de aquellas instalaciones donde esté establecido. Realizar las operaciones reglamentarias definidas en los reglamentos de las instalaciones o en las instrucciones técnicas que las desarrollan, y que los valores correspondientes de los diferentes parámetros se mantengan dentro de los límites exigidos a éstos. Elaborar planes de mantenimiento de aquellos oficios que específicamente no se definen legalmente. Guardar y custodiar los libros de mantenimiento, manual de instrucciones, libro de visitas establecidos en la legislación vigente o los que en un futuro puedan establecerse. Tener cuidado de la sala de máquinas, instalaciones, cuadros eléctricos, transformadores, taller y aquellos materiales que no le sean propios. Tener control del montaje, funcionamiento y desmontaje de elementos necesarios para el normal desenvolvimiento de actividades del centro. Realizar todas las funciones que tengan señaladas los oficiales de los servicios técnicos, y como encargado de este departamento, responsabilizarse directamente de los trabajos efectuados y de su distribución, de la realización y cumplimiento de las órdenes que le dé la empresa, de recibir los partes de averías de los respectivos jefes de sección. Tener en cuenta que el personal a su cargo cumpla con regularidad su actividad profesional y comunicar a la dirección las faltas que vea. En el ejercicio de su cargo, dar las máximas facilidades para la obtención de una perfecta formación profesional.',NULL,15,'187','PT00190');
