VALUES (1774,'Trazado de figuras geométricas planas y elementos estructurales',9,'Conocer el trazado de distintas figuras geométricas planas, como la construcción de un octaedro, el trazado de ángulos, triángulos y cuadriláteros, la circunferencia, las rectas y los segmentos relacionados.',298,NULL,'UMA-T00111');
VALUES (1775,'Construcción de tubos cilíndricos de chapa',8,'Conocer el sistema de trazado por paralelas y construir tubos cilíndricos por el sistema de paralelas, mediante el manejo de codos de 90º de dos secciones de chapa fina, injertos cilíndricos de ejes perpendiculares de igual diámetro, desviaciones en Y de 120º de cilindros de igual diámetro con bridas en las bocas.',298,NULL,'UMA-T00112');
VALUES (1776,'Construcción de injertos cilíndricos de chapa',8,'Conocer el proceso de desarrollo de injertos cilíndricos con relación entre ejes y diámetros y construir injertos cilíndricos por el sistema de paralelas, injertos cilíndricos de ejes oblicuos de igual diámetro de chapa fina, injertos de ejes perpendiculares contenidos en un mismo plano de distinto diámetro sobre chapa, e injertos cilíndricos de ejes oblicuos contenidos en un mismo plano de diferente diámetro de chapa fina.',298,NULL,'UMA-T00113');
VALUES (1777,'Construcción de conos de chapa',9,'Conocer el sistema de trazado radial y construir conos por el sistema radial, conos truncados de bases paralelas y ejes centrados de vértice accesible en chapa fina, troncos de conos oblicuos con la base mayor normal y la menor oblicua injertada a un cilindro.',298,NULL,'UMA-T00114');
VALUES (1778,'Construcción de injertos cónicos de chapa',10,'Conocer el desarrollo de injertos cónicos con relación entre ejes, bases y secciones, y construir injertos cónicos por el sistema radial, injertos cónicos de ejes oblicuos de distintos diámetros de chapa fina, injertos cónicos de ejes perpendiculares contenidos en un mismo plano de distinto diámetro sobre chapa, injertos cónicos de ejes oblicuos contenidos en un mismo plano de cono recto y oblicuo en chapa fina.',298,NULL,'UMA-T00115');
VALUES (1779,'Construcción de tolvas',10,'Conocer el sistema de trazado por triangulación, conocer el manejo de la plegadora para conformar las tolvas y construir tolvas por el sistema radial: Construir tolvas de boca rectangular a cuadrada con los ejes centrados, tolvas de boca cuadrada a circular con los dos ejes desplazados.',298,NULL,'UMA-T00116');
VALUES (1780,'Construcción de depósitos',10,'Conocer los diferentes tipos y formas de fondos de depósitos, el trazado de gajos curvados para fondo o casquete, las precauciones de manipulación en el acero inoxidable, las técnicas de ensamblado de virolas tanto en vertical como en horizontal y de aplicación de refuerzos, y construir depósitos de acero al carbono e inoxidables, familiarizándose con la construcción de cuerpos, soportes, y refuerzos de depósitos.',298,NULL,'UMA-T00117');
VALUES (1781,'Corte de metales por arco plasma y oxicorte manual aplicado a estructuras metálicas ligeras',10,'Conocer la tecnología del oxicorte manual y las técnicas de corte apropiadas, analizando los elementos de que consta un equipo de oxicorte manual, los defectos del corte como retardo, óxidos, estrías del corte, etc., los gases combustibles y comburentes. Conocer la tecnología del corte por plasma y realizar prácticas de corte, profundizando en los cortes en ascendente, corte en chaflán y corte de perfiles, los tipos de fuentes de energía que se utilizan en el proceso y los distintos tipos de electrodos de wolframio y boquillas, como se transfiere el arco eléctrico.',299,NULL,'UMA-T00118');
VALUES (1782,'Soldadura de chapas y perfiles con electrodo revestido',10,'Conocer la soldadura por arco eléctrico, los equipos utilizados y las fuentes de energía, profundizando en el análisis de intensidad, tensión, resistencia y ley de Ohm, así como en los tipos de electrodos según su recubrimiento y aplicaciones concretas. Conocer diferentes formas de operar ante tensiones y deformaciones longitudinales, transversales y angulares, conocer los diferentes tipos de juntas, secuencia de cordones y preparación de las mismas, y realizar soldaduras de chapas y perfiles con electrodo de rutilo y electrodo básico.',299,NULL,'UMA-T00119');
VALUES (1783,'Soldadura de estructuras metálicas con electrodo revestido posición 2G',10,'Conocer los ángulos de soldeo y ataque en posición 2G, la regulación de los transformadores y rectificadores empleados en la soldadura por arco,  simbología de electrodos (UNE 14003) y las zonas características del arco, influencia del tipo de corriente y polaridad. Realizar soldaduras con electrodo de rutilo sobre chapas y tubería en posición 2 G, analizando el punteado, establecimiento o cebado del arco, la interrupción del arco, el empalme de cordones, las mordeduras, las inclusiones de escoria, la porosidad y las grietas en el cráter.',299,NULL,'UMA-T00120');
VALUES (1784,'Soldadura semiautomática MAG de estructuras ligeras',10,'Conocer la tecnología de soldadura de hilo continuo con gas activo de protección y técnicas de soldeo y establecer el proceso operativo para la unión de chapas, perfiles y tubos, analizando la regulación de tensión, intensidad y velocidad de hilo, los ángulos de ataque, los sentidos hacia delante y hacia atrás, los defectos de falta de fusión, la penetración excesiva o insuficiente, y la porosidad superficial o interna.',299,NULL,'UMA-T00121');
VALUES (1785,'Soldadura semiautomática MIG de depósitos de acero inoxidable',10,'Conocer la tecnología de hilo continuo con gas inerte y técnicas de soldeo, así como la soldabilidad de los aceros inoxidables austeníticos, profundizando en el manejo de pistolas, instalaciones de gases de protección, fuentes de energía, tren de arrastre y rodillos, y analizando presión de arrastre, velocidad de hilo, extensión del alambre, velocidad de alimentación, tensión, caudal de gas, mezclas de gases utilizadas, gases de respaldo y espesor máximo de pasadas.',299,NULL,'UMA-T00122');
VALUES (1786,'Soldadura semiautomática MIG de depósitos ligeros de aluminio',10,'Familiarizarse con los parámetros principales en la soldadura MIG y la soldabilidad del aluminio. Establecer el proceso para la realización de soldaduras para la unión de chapas de aluminio y soldar chapas de aluminio con hilo macizo en las posiciones 1G y 3G en ascendente, así como depósitos de aluminio controlando la temperatura durante el proceso de soldeo.',299,NULL,'UMA-T00123');
VALUES (1787,'Corte de metales por arco plasma y oxicorte automático aplicado a estructuras metálicas ligeras',10,'Conocer los sistemas automatizados de corte, profundizando en el corte automatizado oxiacetilénico recto y en ángulo de 30º y el corte con arco plasma en acero inoxidable y aluminio, y regular los parámetros de corte con oxicorte o arcoplasma en máquinas automáticas.',299,NULL,'UMA-T00124');
VALUES (1788,'Soldadura oxiacetilénica de conductos de tuberías',9,'Conocer el equipo de soldadura oxiacetilénica y aplicar las técnicas y destrezas en el soldeo de chapas y tubos: Soldar chapas de espesores finos en horizontal y ángulo interior con metal de aportación; chapas de espesores finos a tope en vertical ascendente; tubos de espesor de pared fina de acero suave en horizontal a tope y solape rotando el tubo 1G; tubos a tope de espesores finos en posición 2G, 5G y 6G.',299,NULL,'UMA-T00125');
VALUES (1789,'Soldadura de electrodo revestido en tuberías de acero al carbono',10,'Conocer las distintas posiciones de soldeo según el código ASME, diferenciando las posiciones de soldeo según el código ASME y la EN, y aplicar las técnicas y destrezas necesarias en el soldeo de tubos de espesores medianos de acero al carbono: Soldar tubos a tope de espesor fino en posición 2G y soldar tubos a tope de espesor medio en posición 5G.',299,NULL,'UMA-T00126');
VALUES (1790,'Soldadura TIG de tuberías de acero al carbono',10,'Familiarizarse con el proceso TIG, los parámetros de regulación y la preparación de las juntas a unir, y aplicar las técnicas y destrezas necesarias en el soldeo de tubos de espesores finos y medios: Soldar tubos de espesor de pared fina y media de acero suave en horizontal a tope y solape rotando el tubo 1G, tubos a tope de espesor fino en posición 2G y tubos a tope de espesor medio en posición 6G, controlando la regulación de intensidad, tensión y polaridad.',299,NULL,'UMA-T00127');
VALUES (1791,'Uniones heterogéneas por oxigás: soldeo fuerte y blando',10,'Conocer las diferentes técnicas aplicadas para soldaduras disimilares con soldeo oxiacetilénico y soldar chapas de acero al carbono con varilla de latón, tubos de acero al carbono de espesores finos con metal de aportación y varilla de latón, tubos de cobre con metal de aportación, cobre estaño y plata.',299,NULL,'UMA-T00128');
VALUES (1792,'Tecnología y normativa en soldadura y corte',10,'Conocer y aplicar las normas especificas relacionadas con la soldadura de estructuras metálicas y el corte de metales de calidad (normas UNE 14.003, UNE 14.028, UNE 14.009, de construcciones soldadas), y profundizar en las técnicas de aplicación en el montaje de estructuras y construcciones soldadas.',300,NULL,'UMA-T00129');
VALUES (1793,'Normativa para homologaciones en uniones F con electrodos',10,'Conocer y comparar la designación de posiciones de soldeo y rangos de cualificación en la homologación de estas posiciones del código ASME y norma EN y analizar las recomendaciones ASME en posición 1F, 2F, 3F y 4F,  profundizando en la sección IX ASME en juntas de rincón y ángulo exterior e interior, con especificaciones técnicas de homologación.',300,NULL,'UMA-T00130');
VALUES (1794,'Práctica para homologaciones en uniones F con electrodos',10,'Soldar chapas con electrodos básico y rutilo, en juntas de rincón y ángulo exterior e interior, y conocer la obtención de homologación en posiciones F: Soldar chapas de acero suave en ángulo interior horizontal (1F) y posición acunada, con electrodos revestidos rutilo y básico; chapas de acero suave en ángulo interior horizontal (2F) con electrodos básicos y rutilos; chapas de acero suave en vertical ascendente (3F) con electrodos rutilos y básicos; y chapas de acero suave en posición bajo techo (4F) con electrodos rutilo y básicos.',300,NULL,'UMA-T00131');
VALUES (1795,'Soldadura de estructuras y depósitos para homologaciones por el procedimiento MAG MIG',10,'Conocer las características del procedimiento de soldadura MAG MIG y establecer el proceso operativo conforme a los requerimientos de homologación: Soldar chapas de acero al carbono de espesores gruesos con hilo macizo en las posiciones 1F, 2F y 3F; chapas de acero al carbono de espesores gruesos con hilo macizo en la posición 2G; chapas de acero al carbono de espesores gruesos con hilo macizo en la posición 3G; perfiles normalizados de L, T, Y y U con hilo macizo en diferentes posiciones de soldeo y formas de unión; tubos de espesores medios y gruesos con hilo macizo en posición 2G; y  tubos de espesores medios y gruesos con hilo macizo en posición 3G.',300,NULL,'UMA-T00132');
VALUES (1796,'Soldadura de depósitos para homologaciones en uniones con chaflanes con electrodos',10,'Familiarizarse con la normativa básica de recipientes de media y baja presión, conocer las pruebas hidrostáticas de estanqueidad, y preparar chaflanes en chapas de acero al carbono con achaflanadora, herramientas manuales y motorizadas, ajustando el ángulo y talón, según simbología de preparación de bordes: Soldar chapas achaflanadas de aceros al carbono en posición horizontal 1G; chapas achaflanadas de aceros al carbono en cornisa (posición 2G según ASME IX); chapas achaflanadas en vertical (posición 3G según ASME IX); y chapas achaflanadas bajo techo (posición 4G, según ASME IX).',300,NULL,'UMA-T00133');
VALUES (1797,'Soldadura de acero inoxidable para homologaciones G con TIG',10,'Adquirir conocimientos sobre los fundamentos del procedimiento TIG para soldadura de aceros inoxidables, la soldabilidad del material y la soldabilidad de los aceros inoxidables austeníticos. Soldar aceros inoxidables con arco TIG con especificaciones de homologación: Realizar el afilado del electrodo y el montaje en la antorcha y Soldar en la posición 1G, 2G, 3G y 4G con penetración TIG.',300,NULL,'UMA-T00134');
VALUES (1798,'Soldadura de depósitos de acero inoxidable para homologaciones por el procedimiento MIG',15,'Familiarizarse con los elementos de la instalación y regulación de parámetros y establecer el proceso operativo conforme a los requerimientos de homologación. Soldar chapas de acero inoxidable con hilo macizo en la posición 1G, 2G y 3G en ascendente, así como depósitos de acero inoxidable controlando la temperatura durante el proceso de soldeo.',300,NULL,'UMA-T00135');
VALUES (1799,'Soldadura de estructuras y depósitos de aluminio por el procedimiento MIG',10,'Analizar la soldabilidad de las aleaciones ligeras, aplicar las técnicas para el soldeo de estructuras y depósitos de aluminio, regular los parámetros principales, conocer las técnicas operativas y preparar los chaflanes para soldar chapas de aluminio con hilo macizo en juntas a tope, chaflán V, ángulos y solape en posición horizontal; chapas de aluminio en juntas a tope, chaflán V y ángulos en posición vertical; y chapas de aluminio en juntas a tope, chaflán V y solape en cornisa.',300,NULL,'UMA-T00136');
VALUES (1800,'Soldadura de aleaciones de aluminio por el procedimiento TIG',10,'Conocer las técnicas operatorias de la soldadura TIG del aluminio y la soldabilidad de este material, realizar el afilado del electrodo y montaje en la antorcha, y aplicar las técnicas y destrezas para soldeo de aluminio y aleaciones ligeras: Soldar en juntas a tope, ángulos y solapes en la posición horizontal; soldar en juntas a tope y ángulos en la posición vertical; soldar en juntas a tope en cornisa; soldar en juntas a tope y ángulos bajo techo; y soldar perfiles de aluminio en todas las posiciones.',300,NULL,'UMA-T00137');
VALUES (1801,'Soldadura de aceros aleados y plaqueados con electrodo',10,'Conocer las diferentes técnicas de ejecución de los recargues y plaqueados con electrodos revestidos, realizar el soldeo de aceros aleados de complicada soldabilidad y realizar plaqueados con electrodos especiales: Preparar juntas y superficies para soldadura de aceros plaqueados, soldar aceros aleados al cromo molibdeno con electrodos especiales, soldar con electrodos especiales en aceros al níquel y plaquear con electrodos revestidos de acero al carbono, especiales e inoxidables.',300,NULL,'UMA-T00138');
VALUES (1802,'Soldadura de aceros aleados y plaqueados con TIG',10,'Conocer las técnicas de ejecución de los recargues y plaqueados con TIG y realizar el soldeo de aceros aleados de complicada soldabilidad con el procedimiento TIG: Preparar chaflanes y superficies, soldar aceros aleados al cromo molibdeno con TIG, soldar en aceros aleados al níquel con TIG y plaquear con el procedimiento TIG.',300,NULL,'UMA-T00139');
VALUES (1803,'Corte de metales por arco plasma y oxicorte manual aplicado a estructuras metálicas pesadas',9,'Familiarizarse con las características de los equipos de oxicorte manual y de corte por arco plasma manual y aplicar destrezas manuales para realizar operaciones de corte en chapas, perfiles y tubos: Oxicorte recto en chapas de acero al carbono con carro y a pulso; oxicorte de chapas a chaflán con carro y a pulso; oxicorte circular y perforación en chapas con carro y a pulso; oxicorte recto de perfiles normalizados, redondos y tubos a pulso; corte con arco plasma manual chapas de acero al carbono; cortes rectos y circulares en chapa de aluminio con arco plasma manual; cortes rectos, circulares y en chaflán en chapas de acero inoxidable y al carbono, con arco plasma manual.',300,NULL,'UMA-T00140');
VALUES (1804,'Corte de metales por arco plasma y oxicorte automático aplicado a estructuras metálicas pesadas',8,'Conocer el sistema automatizado de corte oxiacetilénico y de corte por plasma, así como los procesos operativos de los dos procedimientos de corte: Posicionado de material a cortar, uso de plantillas y planos, puesta a punto de los parámetros de corte con oxicorte o arcoplasma, defectología del corte y subsanación.',300,NULL,'UMA-T00141');
VALUES (1805,'El entorno de AutoCAD',4,'Adquirir conocimientos básicos sobre el diseño asistido por ordenador, ejecutar AutoCAD y describir las distintas partes del entorno: menús, barras de herramientas, paletas, etc. Conocer cómo salir del programa, guardar el dibujo, utilizar la ventana de comandos y utilizar el sistema de ayuda de AutoCAD.',301,NULL,'UMA-T00142');
VALUES (1806,'Dibujo básico con AutoCAD',5,'Conocer las distintas formas de crear un nuevo dibujo y de establecer las unidades de trabajo, los límites, el forzado de coordenadas y la configuración de la rejilla. Manejar objetos sencillos como líneas, arcos, elipses, curvas spline, rectángulos y polígonos, y familiarizarse con los tipos de coordenadas y de zoom. Utilizar la entrada dinámica, deshacer y rehacer acciones, copiar objetos y profundizar en los comandos REDIBUJA, REGEN y MARCAAUX.',301,NULL,'UMA-T00143');
VALUES (1807,'Edición básica de objetos en AutoCAD',5,'Buscar y abrir archivos con dibujos, crear y utilizar plantillas, localizar puntos de los objetos utilizando la referencia a objetos, el AutoSnap y el AutoTrack, dibujar círculos, arandelas, polilíneas y líneas múltiples, seleccionar, recortar y borrar objetos dibujados, utilizar el comando PUNTO, utilizar las formas de distribución en pantalla de las ventanas, empalmar o unir dos objetos y realizar la unión con chaflanes, obtener el punto medio entre dos puntos y cambiar la escala o tamaño de los objetos.',301,NULL,'UMA-T00144');
VALUES (1808,'Textos de una línea y párrafos de texto en AutoCAD',4,'Conocer cómo elegir el estilo de texto en los dibujos con TEXTO y TEXTODIN, alinear y justificar el texto, crear textos con varias líneas (texto múltiple o párrafos) con el comando TEXTOM, insertar símbolos y campos, definir sangría y tabulación, buscar y reemplazar una palabra o frase, y hacer la revisión ortográfica del texto.',301,NULL,'UMA-T00145');
VALUES (1809,'Las capas en AutoCaD',4,'Familiarizarse con el trabajo en capas, la carga y utilización de los tipos de línea, la creación de capas, la distribución de distintas partes del dibujo en capas y la utilización de filtros y grupos de capas.',301,NULL,'UMA-T00146');
VALUES (1810,'Dibujo y edición avanzados con AutoCAD',8,'Conocer el modo de desplazar y rotar objetos dibujados, establecer el orden de visualización de objetos solapados, dibujar a mano alzada con el comando BOCETO, manejar matrices y simetría, aplicar sombreados y degradados en figuras cerradas, crear copias de objetos en filas y columnas, alrededor de un eje o por simetría, agrupar objetos, utilizar propiedades, editar objetos para estirarlos (pinzamientos), alinearlos, descomponerlos en trozos, dividirlos o alargarlos, y cambiar los valores de las variables con MODIVAR.',302,NULL,'UMA-T00147');
VALUES (1811,'Impresión de dibujos en AutoCAD',4,'Adquirir conocimientos para combinar distintas herramientas y técnicas que permitan trazar un dibujo complejo.',302,NULL,'UMA-T00148');
VALUES (1812,'Acotación con AutoCAD',6,'Conocer los diferentes tipos y estilos de acotaciones y tolerancias que se pueden aplicar a un dibujo para mostrar las medidas de los objetos.',302,NULL,'UMA-T00149');
VALUES (1813,'Trabajo con bloques en AutoCAD',4,'Trabajar con grandes dibujos mediante la creación e inserción de bloques y bibliotecas de bloques, la limpieza de los dibujos de los objetos que no se utilizan, el dibujo de líneas activando el modo orto, el giro de la rejilla un cierto ángulo, la creación y asignación de atributos a los bloques, así como la utilización de parámetros y acciones en bloques dinámicos.',302,NULL,'UMA-T00150');
VALUES (1814,'Inserción de objetos en AutoCAD',4,'Conocer las formas de intercambio e inclusión de objetos en el dibujo mediante la tecnología OLE, la vinculación de bloques a un dibujo con referencias externas, la inclusión de imágenes en un dibujo y la creación y modificación de tablas.',302,NULL,'UMA-T00151');
VALUES (1815,'Comandos de consulta y DesignCenter',4,'Conocer los comandos utilizados para obtener información del dibujo, como el tipo y número de objetos, sus coordenadas, capas, fecha y hora de creación o actualización del dibujo, identificación de las coordenadas de un punto, medir distancias, ángulos y áreas o utilizar la calculadora. Familiarizarse con el manejo de la paleta de AutoCAD que permite buscar y organizar datos, bloques, capas y otros contenidos del dibujo, así como acceder a la biblioteca de símbolos.',302,NULL,'UMA-T00152');
VALUES (1816,'Fundamentos de dibujo en 3D con AutoCAD',20,'Conocer la especificación de coordenadas 3D y la regla de la mano derecha, definir un sistema de coordenadas personales (SCP), visualizar en espacio 3D (líneas de mira, vistas, planos delimitadores, líneas ocultas), crear objetos (modelos alámbricos, mallas y sólidos), editar en espacio (rotación de objetos, disposición en matriz, reflexión en simetría, recorte, alargamiento y empalme de objetos en 3D) y editar sólidos 3D (achaflanado, empalme, seccionado y corte de sólidos).',303,NULL,'UMA-T00153');
VALUES (1817,'Creación de imágenes tridimensionales con AutoCAD',10,'Familiarizarse con la utilización de imágenes 3D y el dibujo de modelos 3D (superficies y objetos que se tocan o intersecan). Aprender a crear imágenes con líneas ocultas, imágenes sombreadas o imágenes modelizadas.',303,NULL,'UMA-T00154');
VALUES (1818,'Render en AutoCAD',10,'Conocer la utilización de Render en cuanto a carga e interrupción, condiciones y fusión de modelizado, configuración de luces e iluminación, modificación y enlace de materiales de modelizado, visualización e impresión de imágenes modelizadas; y conocer su utilización con aplicaciones relacionadas como 3D Studio, AME y Autosurf.',303,NULL,'UMA-T00155');
VALUES (1819,'Utilización de imágenes de trama en AutoCAD',10,'Conocer el manejo de imágenes de trama en dibujos, el enlace y atribución de escala a imágenes de trama, la gestión de imágenes de trama, la modificación de imágenes y contornos de imagen, y la delimitación de imágenes.',303,NULL,'UMA-T00156');
VALUES (1820,'Creación de documentos compuestos con OLE en AutoCAD',10,'Comprender la terminología OLE, la vinculación e incrustación y la información de AutoCAD en otras aplicaciones, crear otros formatos de archivos (DWF, DXF, ACIS, tridimensionales, WMF de Windows, BMP, PostScript), grabar sólidos en formato estereolitográfico y familiarizarse con archivos creados con formatos distintos (DXF, DXB, ACIS SAT, 3D Studio, WMF de Windows, PostScript).',303,NULL,'UMA-T00157');


