VALUES (2,'Proporcionar apoyo técnico para la toma de decisiones de la Dirección General. Proporcionar soporte y consejo en los temas coincidentes con su formación académica y profesional. Asumir por delegación funciones propias del Director General. Dirigir y coordinar aquellos proyectos que requieran una la intervención de distintas áreas o departamentos.');
