VALUES (189,'Colaborar en la definición de objetivos y estrategias de la compàñía. Participar en la toma de decisiones a través de su incorporación al comité de Área. Filtra y elaborar la información para la eficaz toma de decisiones por parte de la Área General. Asumir el control de proyectos o áreas de negocio clave para la organización. Representación externa de la empresa en aquellos actos en los que no pueda asistir el Director General.');
