VALUES (11,'Leer e interpretar planos y croquis de mecanismos o máquinas y de sus elementos o piezas; conforme a ellos, trazar, marcar y acabar la superficie de estos elementos, de tal forma que permita el asiento o ajuste entre ellas con juegos o huelgas variables, según las circunstancias, de utilizar para ello otras herramientas o útiles y efectos que el cincel o buril, las diversas variedades de limas y el polvo esmeril, y montar máquinas y mecanismos, asegurando la nivelación, huelgos y equilibrado de las piezas, si así lo requieren.');
VALUES (12,'Leer planos o croquis de obras o de fábrica y replantearlos sobre terreno. Construir con ladrillo muros, paredes o tabiques utilizando cargas de mortero admisibles, debidamente aplomados y sin pandeos. Construir arcos, bóvedas o bovedillas de distintas clases, también con las menores cargas de mortero posible y, cuando fuera menester, con labrado de los ladrillos para su perfecto asiento a hueso; maestrar, revocar, blanquear, lucir, enlatar, correr molduras y hacer tirolesas y demás decoraciones corrientes y revestir pisos y paredes con baldosas o azulejos y tuberías o piezas de máquinas con productos de amianto y similares.');
VALUES (16,'Realizar tareas relativas a la recepción, expedición o movimientos de mercancías. Cumplimentar albaranes y gestionar facturas. Realizar tareas de inventario. Preparar materiales.');
VALUES (21,'Recepcionar, clasificar y preparar la madera en rollo. Aserrar la madera en rollo. Reaserrar y clasificar la madera aserrada. Tratar la madera contra el azulado.');
VALUES (33,'Leer e interpretar planos con croquis de carpintería o estructura metálica o de calderería y, conforme a ellos, realizar las labores de trazar, plantillar, enderezar, marcar, cortar, cepillar, punzonar, taladrar, curvar, armar, escariar, remachar, uñetear, cincelar, retacar y montar los elementos que la integran. Calentar y cortar con soplete y modelar las chapas o perfiles en caliente, mediante martillo. Leer e interpretar planos y croquis de construcción en cobre, latón y otros metales y, conforme a ellos, realizar las labores de batir, estirar, soldar, trazar, plantillear, enderezar, cortar, taladrar, curvar, armar, remachar y montar los elementos que las integran. Plantillear, cortar, roscar, curvar, ajustar, soltar bridas, encuadrar, calentar con soplete, montar y probar tuberías de cobre, latón y hierro, todo ello sin deformaciones, con arreglo a las formas y radios indicados en los planos.');
VALUES (38,'Leer e interpretar planos o croquis de construcción de madera y realizar con las herramientas de máquinas correspondientes las operaciones de trazar, aserrar, cepillar, mortajar, espigar, encelar y demás operaciones de ensamblaje; todo ello acabado con arreglo a las dimensiones de los planos.');
