VALUES (215,'Promocionar y vender los artículos bajo su responsabilidad. Realizar labores de cobro de los artículos cuya venta le está confiada. Cuidar el recuento de la mercancía para proceder a su reposición en tiempo oportuno, así como de su etiquetado, orden y adecentamiento.');
VALUES (25,'Realizar las labores de limpieza de maquinaria, fogones y demás elementos de cocina. Preparar e higienizar los alimentos. Transportar pedidos y otros materiales de su área. Realizar trabajos auxiliares para la elaboración de productos. Encargarse de las labores de limpieza del menaje, comedor y la cocina.');
VALUES (27,'Preparar, transportar y recoger los materiales y productos necesarios para la limpieza y mantenimiento de habitaciones y áreas públicas e internas. Preparar las salas para reuniones, convenciones, etc. Limpiar las áreas y realizar labores auxiliares.');
VALUES (28,'Realizar el control, almacenaje y transporte de los equipos de los clientes en las dependencias del hotel o a las puertas de acceso a éste. Encargarse de la ejecución de gestiones y encargos sencillos, tanto en el interior como en el exterior del establecimiento. Colaborar en el mantenimiento del orden y de la limpieza en las zonas de recepción y conserjería. Vigilar las instalaciones y comunicar las incidencias al departamento correspondiente. Controlar la entrada y salida de objetos, mercancías, proveedores y personal. Encargarse de conducir y estacionar los vehículos de los clientes, a petición de éstos, así como su vigilancia y custodia.');
VALUES (29,'Realizar preparaciones básicas, así como cualquier otra relacionada con las elaboraciones culinarias que le sean encomendadas. Preparar platos para los que haya recibido oportuno adiestramiento. Realizar las funciones del servicio en cocina bajo la supervisión y directrices emanadas directamente del mismo o persona en quien éste delegue. Realizar las tareas derivadas del perfil de la ocupación.');
VALUES (31,'Preparar todo tipo de bebidas. Recibir, despedir, ubicar y aconsejar a los clientes. Preparar diferentes tipos de cócteles y bebidas combinadas. Tomar los pedidos, distribuir y servir las bebidas con sus acompañamientos. Examinar y controlar las existencias de mercancías.');
VALUES (34,'Preparar las áreas de trabajo para el servicio. Realizar la atención directa al cliente para el consumo de bebidas o comidas. Elaborar para consumo viandas sencillas. Transportar útiles y enseres necesarios para el servicio. Controlar y revisar mercancías y objetos de uso de la sección. Colaborar en el montaje, servicio y desmontaje de buffets. Realizar trabajos a la vista del cliente tales como flamear, cortar, trinchar, desespinar, etc. Colaborar con el jefe de comedor en la preparación y desarrollo de acontecimientos especiales. Informar y aconsejar al cliente sobre la composición y confección de los distintos productos a su disposición. Atender reclamaciones de clientes.');
VALUES (35,'Limpiar y ordenar las habitaciones, baños y pasillos entre las habitaciones de clientes. Controlar el material, productos de los clientes y comunicar a sus responsables las anomalías en las instalaciones y los objetos perdidos. Realizar la atención directa al cliente en las funciones propias de su área. Realizar las labores propias de lencería y lavandería.');
VALUES (79,'Establecer las necesidades de mercancías y material de acuerdo con las demandas de las diferentes áreas de la empresa. Elaborar las peticiones de ofertas, evaluación y recomendación de las adquisiciones. Controlar y planificar las existencias, en coordinación con otras secciones del establecimiento. Organizar, supervisar y realizar las labores propias de su área.');
VALUES (80,'Realizar las programas de mantenimiento preventivo y correctivo de las instalaciones. Organizar, dirigir y coordinar al personal a su cargo. Dirigir y planificar el conjunto de actividades de su área. Instruir a los trabajadores de su área. Dirigir, supervisar, controlar y efectuar el cálculo de costes de las reparaciones, modificaciones y mantenimiento de las instalaciones. Proponer a la dirección las mejoras e innovaciones de equipos e instalaciones.');
VALUES (81,'Seleccionar los productos de mantenimiento y limpieza para el uso diario. Inspeccionar y participar en la limpieza de áreas. Llevar el control de las habitaciones y su ocupación, así como de las salas. Participar en estadísticas y elaborar informes en relación con las tareas propias de su área.');
VALUES (82,'Organizar, dirigir y coordinar el personal a su cargo. Dirigir y planificar el conjunto de actividades de su área. Dirigir, supervisar y controlar las compras y existencias de ropa blanca, productos de mantenimiento y limpieza. Encargarse del control e inventario de mobiliario, enseres y materiales de las habitaciones y organización del trabajo de servicio de pisos, áreas públicas, internas y lavandería. Elaborar las estadísticas e informes de su área a la dirección del hotel y otros departamentos, así como la dirección de la formación del personal a su cargo.');
VALUES (103,'Organizar, controlar y coordinar todo el proceso de preparación y distribución de la producción a su cargo. Cuidar de que la producción reúna las condiciones exigidas, tanto higiénicas como de montaje. Organizar, instruir y evaluar el personal a su cargo.');
VALUES (104,'Organizar, dirigir y coordinar el trabajo del personal a su cargo. Dirigir y planificar el conjunto de actividades de su área. Realizar inventarios y controles de materiales, mercancías, etc., de uso en el área de su responsabilidad. Diseñar platos y participar en su elaboración. Realizar propuestas de pedidos de mercancías y materias primas y gestionar su conservación, almacenamiento y rendimiento. Supervisar y controlar el mantenimiento y uso de maquinaria, materiales, utillaje, etc. del área, realizando los correspondientes inventarios y propuestas de reposición. Colaborar en la instrucción del personal a su cargo.');
VALUES (107,'Participar en el control de aprovisionamientos, conservación y almacenamiento de mercancías. Elaborar informes sobre la gestión de los recursos y procesos de su partida y/o servicio. Colaborar en la instrucción del personal a su cargo. Colaborar en las funciones del cocinero.');
VALUES (108,'Organizar, dirigir y coordinar el trabajo del personal a su cargo. Dirigir, supervisar y planificar el conjunto de actividades del área de recepción. Coordinar y participar con otros departamentos en la gestión del establecimiento. Colaborar con la dirección del establecimiento y/o con otros departamentos. Colaborar en la instrucción del personal a su cargo.');
VALUES (109,'Organizar, dirigir y coordinar el trabajo del personal a su cargo. Dirigir, planificar y realizar el conjunto de actividades de su área. Realizar inventarios y controles de materiales, mercancías, etc., de uso en el departamento de su responsabilidad. Hacer las propuestas de pedidos de mercancías y realizar los pedidos si así se le encomienda. Participar en la formación de personal a su cargo. Realizar las tareas de atención al cliente específicas del servicio.');
VALUES (111,'Ocuparse de preparar y decorar las salas y mesas del restaurante. Colaborar en recibir, despedir, ubicar y aconsejar a los clientes sobre los menús y las bebidas. Realizar trabajos a la vista del cliente (flamear, cortar, trinchar, desespinar, etc.). Revisar los objetos de uso corriente. Almacenar y controlar las mercancías y objetos de uso corriente en el ámbito del restaurante.');
VALUES (140,'Ejecutar las labores de atención al cliente en la recepción. Realizar las gestiones relacionadas con la ocupación y venta de las habitaciones. Custodiar los objetos de valor y el dinero depositados. Realizar labores propias de la facturación y cobro, así como el cambio de moneda extranjera. Recibir, tramitar y dirigir las reclamaciones de los clientes a los servicios correspondientes.');
VALUES (142,'Recibir y acompañar a aquellos clientes que la dirección indique. Informar a los clientes de todos los servicios que están a su disposición. Prestar sus servicios tanto dentro como fuera del establecimiento. Gestionar las reservas de cualquier servicio que ofrezca la empresa.');
VALUES (145,'Realizar elaboraciones a base de las materias primas. Preparar las masas de uso en la cocina para la elaboración de pastelería, repostería y bollería. Realizar pedidos, control y conservación de materias primas de uso en su trabajo. Realizar el cálculo de costes relacionados con sus cometidos. Preparar y disponer los productos para buffets, banquetes, etc., colaborando en el arreglo y reparto. Participar en el control de aprovisionamientos. Organizar y controlar el personal a su cargo.');
VALUES (190,'Participar en el trabajo de la bodega: Recepción y revisión de las entregas, control del embotellado, encorchado y etiquetado de los vinos así como la clasificación, almacenamiento y vigilancia de los mismos. Participar en la elaboración de la carta de vinos y bebidas y en la promoción de ventas. Aconsejar al cliente en la elección de las bebidas conforme a la comida escogida. Colaborar en el pedido y administración de las reservas en vinos y en el cálculo de ventas. Cuidar la limpieza de los utensilios de la bodega (vasos, etc.). Planificar, organizar y controlar la bodega.');
VALUES (193,'Organizar y controlar, bajo la supervisión del jefe de sector los procesos de preparación y distribución de servicios y equipos. Supervisar y controlar la entrega de los servicios y equipos a los clientes, cumplimentando los formularios y comprobantes que sea preciso. Atiende al servicio. Controlar la asistencia y presencia del personal a su cargo. Planificar, dirigir y enseñar al personal a su cargo.');
VALUES (55,'Dirigir y coordinar todas las actividades del centro hacia la consecución del proyecto educativo del mismo, de acuerdo con las disposiciones vigentes y sin perjuicio de las competencias atribuidas al Consejo Escolar del centro y a su Claustro de profesores. Ostentar la representación del centro y representar a la Administración educativa en el centro, sin perjuicio de las atribuciones de las demás autoridades educativas.  Cumplir y hacer cumplir las leyes y demás disposiciones vigentes. Colaborar con los órganos de la Administración educativa en todo lo relativo al logro de los objetivos educativos del centro. Designar al Jefe de Estudios, al Secretario, así como a cualquier otro órgano unipersonal de gobierno que pueda formar parte del equipo directivo, salvo el Administrador y proponer sus nombramientos y ceses a la Administración educativa correspondiente. Ejercer la jefatura de todo el personal adscrito al centro. Favorecer la convivencia en el centro e imponer las correcciones que correspondan de acuerdo con lo establecido por las Administraciones educativas y en cumplimiento de los criterios fijados por el Consejo Escolar del centro. Convocar y presidir los actos académicos y las reuniones de todos los órganos colegiados del centro y ejecutar los acuerdos adoptados en el ámbito de su competencia. Autorizar los gastos de acuerdo con el presupuesto del centro, ordenar los pagos y visar las certificaciones y documentos oficiales del centro. Realizar las contrataciones de obras, servicios y suministros de acuerdo con lo establecido en la normativa vigente.Cuantas otras competencias se le atribuyan en los correspondientes reglamentos orgánicos.');
VALUES (74,'Organiza actividades educativas individuales o colectivas con miras a alentar y facilitar el desarrollo de las aptitudes físicas, mentales y sociales de niños de edad inferior a la exigida para su admisión en la enseñanza primaria. Programar y organizar actividades destinadas a estimular el desarrollo físico y la sociabilidad de los niños. Promover la facilidad de expresión de los niños narrando cuentos y organizando sesiones de simulación de papeles o teatro infantil, recitación de poemas para niños, danzas y canciones infantiles, conversación y discusión. Observar a los niños para poder evaluar sus progresos y poner al corriente a los padres de los resultados logrados o de los problemas detectados. Supervisar a los niños durante su actividades preescolares para garantizar su seguridad y resolver los conflictos que puedan acaecer.');
VALUES (105,'Dirigir y coordinar las actividades derivadas de las funciones asignadas al Departamento. Organizar, convocar y presidir las diferentes reuniones que celebre el Departamento. Responsabilizarse y participar en las tareas que se derivan de la elaboración de los Proyectos Curriculares, en la aportación que el Departamento debe efectuar para elaborar el Proyecto Educativo y la Programación General Anual, así como redactar la Programación Didáctica de las áreas, materias o módulos que se integran en el Departamento, la Memoria final de curso y la elaboración de las adaptaciones curriculares que, en su caso, se determinen. Coordinar y velar por el cumplimiento de la Programación Didáctica del Departamento y la aplicación correcta de los criterios de evaluación.  Informar al alumnado acerca de la Programación Didáctica de las áreas, materias y módulos del Departamento, con especial referencia a los objetivos, los mínimos exigibles y los criterios de evaluación. Organizar, preparar y supervisar, en coordinación con la Jefatura de Estudios, las pruebas para los alumnos de Bachillerato o Ciclos Formativos con materias o módulos pendientes, así como las pruebas de los alumnos libres o las pruebas extraordinarias que hubiere. Presidir la realización de los ejercicios correspondientes, y evaluarlos en colaboración con los miembros del Departamento. Coordinar la atención a los alumnos de Educación Secundaria Obligatoria que tengan áreas y materias no superadas correspondientes al Departamento. Garantizar el cumplimiento del procedimiento de reclamaciones en el proceso de evaluación del alumnado, de acuerdo con la normativa vigente. Custodiar las pruebas y documentos que hayan servido para valorar al alumnado. Coordinar la organización de espacios e instalaciones, proponer la adquisición del material y del equipamiento específico asignado al Departamento y velar por su mantenimiento. Gestionar la asignación económica establecida para su Departamento. ');
VALUES (106,'Elaborar el horario del profesorado. Coordinar y apoyar las funciones de los tutores-as del Centro, especialmente en lo que se refiere a la atención que precisan los alumnos-as en los momentos críticos de su escolaridad. Fomentar la actuación coordinada del profesorado en todos los niveles y ciclos.');
VALUES (134,'Colaborar en la realización de los planes de estudio. Impartir lecciones sobre sus asignaturas y supervisar el trabajo y la disciplina de los alumnos. Preparar, asignar y corregir ejercicios y trabajos prácticos. Examinar mediante pruebas y exámenes con objeto de evaluar los progresos de los alumnos, y dar las calificaciones correspondientes. Preparar informes sobre la labor de los alumnos y consultar a otros profesores y a los padres. Participar en reuniones sobre las políticas del establecimiento en materia de educación y organización. Organizar actividades extraoficiales como círculos o asociaciones de debate o clubes de recreo, o prestarles asistencia. Dirigir estudios personales, seminarios y trabajos prácticos o de laboratorio. Dirigir los trabajos de investigación de estudiantes posgraduados y otros miembros del departamento. Investigar y desarrollar conceptos, teorías y métodos para su aplicación.');
VALUES (135,'Idear o modificar planes de estudio y preparar cursos educativos de conformidad con los requisitos. Impartir lecciones sobre sus asignaturas y supervisar el trabajo y la disciplina de los alumnos. Preparar, asignar y corregir ejercicios y trabajos prácticos. Examinar mediante pruebas y exámenes con objeto de evaluar los progresos de los alumnos, y dar las calificaciones correspondientes. Preparar informes sobre la labor de los alumnos y consultar a otros profesores y a los padres. Participar en reuniones sobre las políticas del establecimiento en materia de educación y organización. Organizar actividades extraoficiales como círculos o asociaciones de debate o clubes de recreo, o prestarles asistencia. Dirigir estudios personales, seminarios y trabajos prácticos o de laboratorio. Dirigir los trabajos de investigación de estudiantes posgraduados y otros miembros del departamento. Investigar y desarrollar conceptos, teorías y métodos para su aplicación.');
VALUES (186,'Ordena el régimen administrativo y económico del Centro con las directrices del Director y lleva la contabilidad. Expide certificaciones. Realiza el inventario general. Custodia los libros y archivos del Centro... los medios audiovisuales, informáticos y el material didáctico y vela por su mantenimiento. Elabora el anteproyecto de presupuesto económico del Centro.');
VALUES (23,'Preparar y administrar los medicamentos según prescripciones facultativas, específicamente los tratamientos. Tomar la presión sanguínea, el pulso y la temperatura. Preparar el material y medicamentos que hayan de ser utilizados. Ordenar las historias clínicas, anotar los datos relacionados con la propia función que deba figurar. Atender al residente encamado por enfermedad, efectuando los cambios posturales prescritos, controlando el servicio de comidas a los enfermos y suministrando directamente a aquellos pacientes que dicha alimentación requiera instrumentalización (sonda nasogástrica, sonda gástrica, etc.). Controlar la higiene personal de los residentes y también los medicamentos y alimentos que estos tengan en las habitaciones. Atender las necesidades sanitarias que tenga el personal que trabaja en el centro y sean de su competencia. Colaborar con los/as fisioterapeutas en las actividades, el nivel de calificación de las cuales sean compatibles con su titulación de ATS/DUE, cuando sus funciones específicas lo permitan. Realizar los pedidos de farmacia, analítica y radiología en aquellos centros donde no exista especialista. Vigilar la ejecución de las actividades de tipo físico recibida por el médico, observando las incidencias que puedan presentarse durante su realización.');
VALUES (45,'Prestar servicio de transporte. Velar por el mantenimiento del vehículo en perfecto estado. Controlar los permisos y documentación administrativa del vehículo.');
VALUES (51,'Higiene personal del usuario. Limpiar y mantenier los utensilios del usuario, mantener ordenadas las habitaciones y encargarse sus ropas. Dar de comer a aquellos usuarios que no lo puedan hacer por sí mismos. Recepción, distribución y recogida de las comidas a los usuarios. Realizar los cambios de postura y aquellos servicios auxiliares que de acuerdo con su preparación técnica le sean encomendados.Comunicar las incidencias que se produzcan sobre la salud de los usuarios. Limpiar y preparar el mobiliario, materiales y aparatos de botiquín. Acompañar al usuario en las salidas que este deba realizar. Realización de tareas elementales que complementen los servicios de los especialistas, en orden a proporcionar la autonomía personal del usuario y su inserción en la vida social. Atender a los familiares de los usuarios y colaborar a la integración de éstos en la vida del centro. Complementar el trabajo asistencial, educativo y formativo que reciban de los profesionales respectivos.');
VALUES (88,'Participar, cuando se le pida, en el equipo multiprofesional del centro para la realización de pruebas o valoraciones relacionadas con su especialidad profesional. Conocer, evaluar e informar y cambiar, en su caso, la aplicación del tratamiento de su especialidad, cuando se den, mediante la utilización de recursos ajenos. Conocer los recursos propios de su especialidad en el ámbito territorial.  Colaborar en las materias de su competencia en los programas que se realicen de formación e información a las familias de los afectados e instituciones. Asesorar a los profesionales que lo necesiten sobre pautas de movilizaciones y los tratamientos en los que tengan incidencia las técnicas fisioterapéuticas. Asistir a las sesiones que se hagan en los centros para la revisión, el seguimiento y la evaluación de tratamientos.');
VALUES (94,'Supervisar la actividad de los trabajadores a su cargo, distribuir las actividades y turnos de las personas que tiene asignadas y vigilar también el buen uso y economía de los materiales, utillaje y herramientas y maquinaria a su cargo; proceder al recuento e inventario de éstos. En coordinación con el departamento de cocina, se responsabilizará de la buena marcha del servicio de comedor, distribución de comidas, control de regímenes, servicios especiales, montaje, limpieza y retirada del servicio. Tener conocimiento del número de servicios diarios realizados en el departamento. En coordinación con el personal de enfermería, llevar el control del buen estado de los alimentos que los residentes tengan en las habitaciones. En los centros, cuyas comidas se realicen mediante conciertos con terceros, colaborar en la confección de los menús, supervisar las condiciones sanitarias de las dependencias y alimentos servidos. Supervisar, cuando haya contrato de limpieza, el buen funcionamiento de los servicios contratados.Colaborar en las actividades propias del personal a sus órdenes.');
VALUES (117,'Hacer los exámenes médicos, diagnósticos, prescribir los tratamientos para llevar a cabo las terapias preventivas, asistenciales y de rehabilitación de los diagnósticos clínicos y funcionales de los residentes del centro. Dirigir el programa de movilización y rehabilitación de los usuarios, fijando en equipo los programas a desarrollar de forma individual y en grupo. Hacer el seguimiento y evaluar los programas conjuntamente con el equipo formado por todas las personas que intervienen. Asistir al personal destinado al centro en los casos de necesidad y de urgencia. En el caso de que el centro no pueda tratar debidamente a los usuarios, derivarlos a un centro hospitalario o de salud. Participar en la comisión de supervisión y seguimiento del usuario en cuanto a las necesidades asistenciales y de la vida diaria de los residentes y de los usuarios del centro de día en colaboración otros profesionales, de acuerdo con la situación física de los usuarios los objetivos a conseguir y las características del centro. Programar y supervisar los menús y dietas alimentarias de los residentes o usuarios. Supervisar el trabajo del personal. Supervisar el estado sanitario de las dependencias del centro.');
VALUES (122,'Controlar las visitas y el trabajo realizado por las firmas contratadas para el mantenimiento de aquellas instalaciones donde esté establecido. Realizar las operaciones reglamentarias definidas en los reglamentos de las instalaciones o en las instrucciones técnicas que las desarrollan, y que los valores correspondientes de los diferentes parámetros se mantengan dentro de los límites exigidos a éstos. Elaborar planes de mantenimiento de aquellos oficios que específicamente no se definen legalmente. Guardar y custodiar los libros de mantenimiento, manual de instrucciones, libro de visitas establecidos en la legislación vigente o los que en un futuro puedan establecerse. Tener cuidado de la sala de máquinas, instalaciones, cuadros eléctricos, transformadores, taller y aquellos materiales que no le sean propios. Tener control del montaje, funcionamiento y desmontaje de elementos necesarios para el normal desenvolvimiento de actividades del centro. Realizar todas las funciones que tengan señaladas los oficiales de los servicios técnicos, y como encargado de este departamento, responsabilizarse directamente de los trabajos efectuados y de su distribución, de la realización y cumplimiento de las órdenes que le dé la empresa, de recibir los partes de averías de los respectivos jefes de sección. Tener en cuenta que el personal a su cargo cumpla con regularidad su actividad profesional y comunicar a la dirección las faltas que vea. En el ejercicio de su cargo, dar las máximas facilidades para la obtención de una perfecta formación profesional.');
VALUES (138,'Realizar la evaluación psicológica de los residentes. Diseñar y aplicar tratamientos. Prestar apoyo a las familias de usuarios. Prestar apoyo psicológico a los profesionales en problemas de naturaleza psicológica derivada de la atención a usuarios. Emisión de informes.');
VALUES (204,'Conocer, proponer y hacer operativos los procesos de intervención cultural en sus vertientes de gestión y educativa. Establecer relaciones entre los ámbitos cultural y educativo con los procesos sociales y económicos. Obtener recursos necesarios y poner en marcha procesos culturales. Coordinación con profesionales de diversa cualificación a la hora de diseñar e implementar estrategias de intervención cultural. Ejecución y presupuestación de proyectos y programas varios, así como realización de los informes y evaluaciones pertinentes. Fomentar el desarrollo integral de los usuarios mediante la acción lúdico-educativa. Desarrollar y ejecutar las diversas técnicas de animación, individuales y/o grupales, que impliquen a los usuarios en la ocupación de su tiempo libre y promover así su integración y desarrollo grupal. Motivar a los residentes ante la importancia de su participación para conseguir su integración y relación positiva con el entorno. Responsabilidad ante cualquier incidencia que surja, en cualquier tipo de labor propia o de los animadores socioculturales, y comunicación a los superiores. Reuniones periódicas con el resto del equipo, así como con los responsables de los diferentes centros donde se realice la labor de animación sociocultural. Coordinación del voluntariado y alumnos en prácticas de animación sociocultural. Docencia, charlas y ponencias que guarden relación con esta categoría profesional. Participar en el plan general de actividades y presupuestos de los diferentes centros.');
VALUES (210,'Diseñar actividades ocupacionales para los residentes. Colaborar en el seguimiento o la evaluación del proceso recuperador o asistencial de los residentes del centro. Participar en las áreas de ocio y tiempos libres del usuario del centro. Colaborar en las materias de su competencia en los programas que se realicen de formación e información a las familias de los usuarios a las instituciones.');
VALUES (213,'Ejecutar las actividades administrativas y realizar los informes sociales de los residentes, y los que le sean pedidos por la dirección del centro, facilitar información sobre los recursos propios, ajenos y efectuar la valoración de su situación personal, familiar y social. Realizar los tratamientos sociales mediante el servicio social de cada caso y de grupo a todos los residentes. Fomentar la integración y participación de los residentes en la vida del centro y de su entorno. Coordinar los grupos de trabajo y actividades de animación sociocultural. Participar en la comisión técnica. Realizar las gestiones necesarias para la resolución de problemas sociales que afecten a los residentes principalmente con las entidades e instituciones locales. Participar, con el equipo multiprofesional o departamento médico en la elaboración de las orientaciones o de la atención que necesiten los residentes. Participar en la asignación y cambio de habitaciones y mesas del comedor con el departamento de enfermería y la dirección. Visitar a los residentes enfermos.');
VALUES (7,'Efectuar pagos en efectivo o cheques contra órdenes escritas, documentos de crédito u operaciones de cambio, y hacer firmar los comprobantes pertinentes. Llevar registros de todas las operaciones tramitadas y comprobar si el balance de caja coincide con los comprobantes respectivos. Recibir dinero en metálico o cheques de los clientes. Efectuar pagos a los clientes. Pagar facturas y efectuar transferencias monetarias en nombre de los clientes. Acreditar y descontar fondos en las cuentas de los clientes. Realizar operaciones de cambio de moneda.');
VALUES (8,'Atender y asesorar a clientes y público en general de los productos de su entidad y de las operaciones corrientes de banca. Tramitar solicitudes de productos y servicios demandados por los clientes de la entidad. Contabilizar, seguir y archivar el proceso de las operaciones corrientes. Captar nuevos clientes y fidelizar los existentes.');
VALUES (65,'Responsabilizarse de la oficina operativa de banca comercial a su cargo. Atención a los clientes en general y a los clientes específicos en particular. Supervisar al personal a su cargo. Tramitar las operaciones de riesgo si sus características lo permiten, o derivarlas a los Directores de Zona si requieren un tratamiento especial.');
VALUES (69,'Visitar periódicamente la zona a su cargo, para comprobar el correcto funcionamiento. Regular las operaciones de riesgo que superen una cantidad determinada, de tal modo que no puedan ser autorizadas por los Directores de Oficina de forma autónoma. Acompañar y asistir a los Directores de Oficina en la gestión bancaria de clientes específicos. Distribuir a los Directores de Oficina los objetivos fijados desde los puestos superiores.');
VALUES (71,'Transmitir las órdenes de la Dirección General a los Directores de Zona. Acompañar y asistir a los Directores de Zona en la gestión bancaria de clientes específicos. Distribuir los objetivos a cumplir a los Directores de Zona. Regular las operaciones de riesgo que implican atribuciones tales que no puedan ser autorizadas por el Director de Zona de manera autónoma.');
VALUES (93,'Actuar como interlocutor para todas las operaciones que puedan afectar a la entidad. Promover los distintos productos y servicios ofrecidos por la entidad. Profundizar y aumentar la clientela de segmento alto. Realizar gesiones y asesoramiento para clientes de este tipo.');
VALUES (99,'Intervenir en todas las operaciones de la oficina que impliquen cualquier tipo de complicación que no pueda ser solventada por los empleados. Autorizar, conjuntamente con el Director de Oficina u otro Interventor/Apoderado, los préstamos que solicitan los clientes. Custodiar efectivo y documentos de la oficina. Ayudar a los empleados en operaciones con complicación mayor de lo habitual. Entrenar a los demás trabajadores (coaching).');
VALUES (100,'Canalizar la operativa proveniente de la atención personalizada a empresas, coordinando y controlando la realización de las acciones asignadas en su ámbito de actuación de acuerdo con las estrategias y objetivos marcados, con el fin de lograr los resultados previstos: supervisar y autorizar las operaciones para empresas, gestionar las operaciones de empresas que requieran su intervención, informar sobre las operaciones al interventor en caso necesario, etc.');
VALUES (101,'Conocer perfectamente las peculiaridades de la administración y trámites de otros países, y del propio para las operaciones con extranjero. Gestionar las operaciones que impliquen relaciones con el extranjero, en cuanto a exportaciones e importaciones, de sus clientes. Asesorar a los clientes sobre las operaciones con el extranjero. Custodiar la moneda extranjera. Responsabilizarse de la emisión de cheques y transferencias al extranjero. Conceder y gestionar créditos de exportación e importación a clientes.');
VALUES (102,'Canalizar la operativa proveniente de la atención personalizada a particulares, coordinando y controlando la realización de las acciones asignadas en su ámbito de actuación de acuerdo con las estrategias y objetivos marcados, con el fin de lograr los resultados previstos: supervisar y autorizar las operaciones para particulares, gestionar las operaciones de clientes particulares que requieran su intervención, informar sobre las operaciones al interventor en caso necesario, etc.');
VALUES (17,'Siguiendo las directrices del responsable del proyecto, determinar con el cliente el desarrollo de la aplicación informática. Proporcionar soporte técnico a los usuarios en la implantación de nuevas aplicaciones informáticas. Resolver las posibles incidencias que se puedan producir durante las pruebas y ejecuciones iniciales de las nuevas aplicaciones desarrolladas. Coordinar el equipo de programadores a su cargo.');
VALUES (18,'Diseño y desarrollo de aplicaciones informáticas. Control de los costes del proyecto. Atención a cliente y usuarios durante las fases de desarrollo y puesta en marcha del proyecto. Resolución de las incidencias que se presenten. Elaboración de la documentación del usuario.');
VALUES (72,'Diseño y desarrollo de aspectos estéticos, de imagen, comercial y de mercadotecnia. Prestar soporte técnico y resolver las incidencias que se puedan producir en la explotación de la páginas web.');
VALUES (92,'Actuar de interlocutor para todas las operaciones que puedan afectar a las actividades de la entidad. Promover los distintos productos y servicios ofrecidos por la entidad. Buscar la rentabilización, profundización y aumento de la clientela.');
VALUES (137,'Confeccionar y poner a punto los programas y completar los expedientes técnicos de los mismos. Prueba y puesta a punto de las unidades asignadas. Realización de programas. Redacción de la documentación correspondiente a los programs en los que participa. Prestación de soporte técnico al cliente y participación en las guardias que se determinen.');
VALUES (155,'Detectar las necesidades informáticas de los clientes. Establecer las especificaciones necesarias para su desarrollo por analistas y programadores. Elaborar, junto con el departamento comercial, de ofertas y establecer precios. Coordinar los trabajos del equipo para el cumplimiento de plazos y espeficaciones.');
VALUES (171,'Desarrollar los procedimientos que garanticen el acceso seguro al sistema informático de la empresa. Administrar equipos gestionando usuarios y claves. Establecer las medidas necesarias que impidan la intromisión externa. Establecer los procedimientos de custodia de la información de la empresa. Minimizar mediante copias de seguridad y otros procedimientos, la pérdida accidental de información.');
VALUES (175,'Establecer con el cliente las principales especificaciones del proyecto. Determinar y asignar los recursos humanos y materiales necesarios al proyecto. Controlar los costes del proyecto. Velar por el cumplimiento de fechas y especificaciones.');

