-- Carga Glosario

VALUES ('A','Adecuación persona-puesto','Grado en que un trabajador cumple los 
requisitos necesarios para desempeñar un determinado puesto de trabajo de manera
óptima.');
VALUES ('B',NULL,NULL);
VALUES ('C','Competencia','Según David McClelland, es una característica subyacente de la persona que
le permite un desempeño superior en un determinado puesto, papel o
situación.
Para Boyatzis, es una característica subyacente en una persona que está
causalmente relacionada con una actuación exitosa en el puesto de trabajo.
Según la Asociación Americana de Retribución, es un comportamiento de
desempeño individual observable, medible y crítico para el desempeño exitoso
de un individuo u organización.');
VALUES ('C','Competencia Excluyente','Aquélla considerada fundamental para el
desempeño del puesto de trabajo, que contará con un mayor peso en la valoración
conjunta de competencias del individuo.');
VALUES ('C','Competencias aportadas o competencias aportadas por el trabajador','Conjunto de competencias de que dispone un trabajador y que pueden ser consideradas
para valorar la adecuación a puestos de trabajo determinados.');
VALUES ('C','Competencias de Actitud','Son dos competencias definidas por la herramienta
como constantes y comunes en todos los puestos de trabajo, por ser consideradas
prácticamente imprescindibles para la realización satisfactoria de cualquier tipo de trabajo y cobrar cada vez más importancia en la gestión por competencias; son las
siguientes:
Motivación: Se relaciona con la disposición mental para la realización de un
trabajo con interés y diligencia, que en la valoración del puesto hará
referencia a la motivación del trabajador hacia ese puesto de trabajo en
concreto, y no de un modo general.
Confianza: Hace referencia a la confianza para la realización del puesto de
trabajo en cuestión, siendo necesario diferenciarla de otras competencias
relacionadas con una autoconfianza genérica.');
VALUES ('C','Competencias de Estrategia','Son dos competencias derivadas de los
objetivos estratégicos de la empresa, comunes por tanto a la inmensa mayoría de los
puestos considerados para una empresa y necesarias para su adecuado desempeño, en
mayor o menor medida. No obstante, podrán existir puestos para los que no se
consideren influyentes de modo relevante, siendo posible su sustitución por otras que
puedan contar con mayor peso para su desempeño satisfactorio.');
VALUES ('C','Competencias Deseables','Son cuatro competencias que dan cuenta de la
diferencia entre un rendimiento estándar y un rendimiento sobresaliente para un
determinado puesto; es decir, son diferenciadoras de un desempeño excelente, pero su
carencia no impide la realización adecuada del trabajo. En la terminología de
competencias se conocen como competencias diferenciadoras.');
VALUES ('C','Competencias Prioritarias','Son cuatro competencias que hacen referencia a
las competencias que debe tener un trabajador exigidas por los procesos productivos y
tareas intrínsecas a su quehacer diario. Son, pues, las distintivas de un determinado
puesto de trabajo y dan cuenta de un desempeño suficiente.');
VALUES ('C','Competencias requeridas o competencias requeridas para el desempeño del puesto de trabajo','Conjunto de competencias necesarias para el adecuado
desempeño de un puesto de trabajo determinado.');
VALUES ('C','Competencias Transversales de Gestión de Equipos','Son el conjunto de
competencias relacionadas con la capacidad del trabajador de dirigir adecuadamente un
equipo de trabajo, formando en lo posible a sus integrantes, distribuyendo
adecuadamente las responsabilidades, etc.');
VALUES ('C','Competencias Transversales de Gestión Empresarial','Competencias que
giran en torno a la capacidad del trabajador de orientar sus habilidades a la gestión de
diferentes secciones de la actividad empresarial, de modo que se ejercite en el
conocimiento, el seguimiento y la mejora continua en la misma.');
VALUES ('C','Competencias Transversales de Gestión Personal','Incluye un grupo de
competencias que hacen referencia a la capacidad y el deseo del trabajador de dirigir su
propio comportamiento y sus cualidades hacia la adaptación al trabajo en la empresa y
al desarrollo del mismo con profesionalidad y transparencia.');
VALUES ('C','Competencias Transversales de Influencia','Son competencias que reflejan
la capacidad del la trabajador para establecer interacciones positivas con otras
personas, de modo que desemboquen en algún beneficio para la organización a través
del puesto de trabajo.');
VALUES ('C','Competencias Transversales de Logro','Las competencias que recoge este
grupo se refieren a la capacidad y el interés del trabajador por dirigir sus esfuerzos a un
desempeño capaz de cubrir con suficiencia las expectativas, incluso por encima de lo
normal o lo esperado.');
VALUES ('C','Competencias Transversales de Pensamiento','Engloba una serie de
competencias relacionadas con el estilo cognitivo y su orientación al mejor desempeño
del puesto de trabajo, así como su eficacia en la toma de decisiones.');
VALUES ('C','Competencias Transversales Suplementarias','Incluye competencias
relativas a la capacidad del trabajador de organizar su propio trabajo de tal modo que
optimice su realización, buscando un desempeño cada vez mejor.');
VALUES ('C','Conocimiento Excluyente','Aquél considerado fundamental para el desempeño
del puesto de trabajo, que contará con un mayor peso en la valoración conjunta de
competencias del individuo.');
VALUES ('C','Conocimientos de Estrategia','Son dos conocimientos que, para una etapa
determinada de la empresa, se consideran fundamentales en la generalidad de la
misma. Al igual que en el caso de las Competencias de Estrategia, derivan de los
objetivos de la empresa, y son susceptibles de ser diferentes para aquellos puestos de
trabajo en que no se consideren importantes, si bien por lo general se mantendrán en
la mayoría de ellos.');
VALUES ('D',NULL,NULL);
VALUES ('E',NULL,NULL);
VALUES ('F','Ficha de Puesto de Trabajo','Registro propuesto para recoger el conjunto de
características y requisitos de competencias, conocimientos, titulaciones y experiencia
que definen cada uno de los puestos de trabajo de la empresa y posibilitan su
comparación con los perfiles de trabajadores existentes para determinar el grado de
adecuación persona-puesto.');
VALUES ('F','Ficha de Trabajador','Registro propuesto para recoger el conjunto de
competencias, conocimientos, titulaciones y experiencia de cada uno de los
trabajadores de la empresa que posibilitan su comparación con los requisitos de los
puestos de trabajo definidos en el organigrama para determinar el grado de adecuación
persona-puesto.');
VALUES ('G','Gestión por Competencias','Modelo de gestión de los recursos humanos de las
empresas basado en la determinación de las competencias específicas requeridas en los
puestos de trabajo para su desempeño óptimo, que junto con la definición del perfil
profesional de los trabajadores, facilita un entorno adecuado para su desarrollo y, en
definitiva, la mejora del desempeño a través de la formación, rotación de puestos,
coaching, mentoring, autodesarrollo, etc.');
VALUES ('G','Guía de Evaluación del Desempeño','Herramienta cuya finalidad es orientar a
los Responsables de Recursos Humanos en el diseño e implantación de un
Procedimiento de Gestión del Desempeño; se trata de un modelo de reflexión,
comunicación y evaluación acerca del nivel de competencia y rendimiento del
trabajador, constituida por un modelo de impresos, un procedimiento y una serie de
recomendaciones sobre el modo en que se podría estimar el grado de eficacia con el
que cada trabajador realiza las tareas correspondientes al puesto de trabajo que ocupa.');
VALUES ('H',NULL,NULL);
VALUES ('I','Índice de Adecuación Persona Puesto (APP)','Indicador que establece una
comparación entre los requisitos de un puesto de trabajo concreto y la aportación de un
trabajador determinado, facilitando una visión del grado en que éste satisface dichos
requisitos y, por tanto, del grado en que se adecua al puesto para el correcto
desempeño. La interpretación del indicador se basa en las siguientes consideraciones:
Teóricamente, puede adoptar valores entre 0 y 100 %, o aparecer como No
valorado en el caso de que el trabajador carezca de alguna Titulación
Excluyente.
Una puntuación del 100 % sería indicativa de un perfil de trabajador que
satisface plenamente los requisitos del puesto de trabajo considerado.
Una puntuación del 0 % sería indicativa de un perfil de trabajador que no
satisface ninguno de los requisitos del puesto de trabajo considerado.
Puntuaciones más elevadas reflejan perfiles de trabajador más adecuados al
puesto de trabajo considerado.
El indicador no es mayor si el trabajador excede los niveles exigidos que si
simplemente los cumple, pues se entiende que la adecuación al puesto existe
desde el momento en que se alcanzan los niveles requeridos para todas las competencias, independientemente de si se exceden o si lo hacen en muchos
puntos.');
VALUES ('I','Índice de Desarrollo Potencial (IDP)','Indicador que establece una medida
del grado en que un trabajador excede los niveles de competencias exigidos para un
determinado puesto de trabajo. La interpretación del indicador se basa en las siguientes
consideraciones:
Su cálculo se realizará únicamente para aquellos casos en que el trabajador
alcance el 100% en el Índice APP, pues se ha considerado que tiene sentido
medir el exceso únicamente a partir del momento en que se cubren todas las
exigencias definidas para el puesto.
Teóricamente, puede adoptar valores entre 0 y 1.000 %. Sin embargo,
resultados de 1.000 % carecen de sentido en la práctica, dado que implicarían
requerimientos, para todas las competencias, de niveles 0, y puntuaciones
para el trabajador con niveles de 10 en todos los casos.
Una puntuación del 0 % sería indicativa de un perfil de trabajador que
satisface por completo los requisitos del puesto, pero no los excede en ningún
caso.');
VALUES ('I','Itinerario profesional','Es un posible recorrido laboral a seguir por los
trabajadores, determinado a partir del análisis de los puestos de trabajo existentes en
la empresa, la relación entre ellos y las competencias requeridas en los trabajadores
para el correcto desempeño de cada uno.');
