VALUES ('N','Nivel 0 de Competencias Transversales o Nivel de tipo Sin evidencia','Con esta valoración se quiere hacer referencia a que la persona no ha mostrado
suficientes conductas que acrediten la presencia de la competencia.');
VALUES ('N','Niveles 1 a 5 de Competencias Transversales o Niveles de tipo Bien','Esta valoración indica que existen evidencias suficientes de la presencia de la
competencia.');
VALUES ('N','Niveles 6 a 8 de Competencias Transversales o Niveles de tipo
Excelente','La valoración del trabajador en estos niveles está indicada cuando
muestra unas conductas asociadas a esta competencia que dan cuenta de un
desempeño notable.');
VALUES ('N','Niveles 9 y 10 de Competencias Transversales o Niveles de tipo
Genera','Los niveles agrupados en esta categoría están reservados, en la mayoría de
los casos, para aquellos trabajadores cuya exhibición de esta competencia no sólo es
indicador de un desempeño sobresaliente sino que, además, son un referente o modelo
de la misma dentro de la empresa o el sector, de forma que contribuyen con su ejemplo
a generar esta competencia entre aquellos que les rodean.');
