VALUES ('P','Plan de carrera','Definición personalizada de la perspectiva laboral y los
sucesivos puestos de trabajo a ocupar por los diferentes trabajadores de la empresa.');
VALUES ('P','Puesto Directivo','Puesto que incluye misiones relacionadas con la organización
del trabajo al más alto nivel en la empresa; se caracteriza por la consecución de
resultados a través de otros de forma más o menos lejana, actuando en un nivel
estratégico y táctico a nivel de políticas y planes.');
VALUES ('P','Puesto de Mando Intermedio o Jefatura','Puesto que, bajo las instrucciones
de los puestos directivos, consigue resultados a través de otros de forma más o menos
próxima, actuando en un plano táctico/operativo a nivel de objetivos, programas,
normas o estándares.');
VALUES ('P','Puesto Político','Puesto que ostenta funciones relacionadas especialmente con
aspectos de representación de la empresa, más que de tipo ejecutivo u organizativo.');
VALUES ('P','Puesto de Técnico Operativo  Trabajador Cualificado','Puesto en el que el
trabajador consigue resultados por sí mismo, actuando en un plano operativo y a nivel
de objetivos, programas, normas o estándares para los que se requiere un determinado
nivel de formación o entrenamiento.');
VALUES ('P','Puesto de Técnico Operativo  Trabajador no Cualificado','Puesto en el que
el trabajador consigue resultados por sí mismo, actuando en un plano operativo y a
nivel de objetivos, programas, normas o estándares para los que no es necesario un
determinado nivel de formación o entrenamiento.');
VALUES ('P','Puesto Técnico','Puesto que aporta a la organización know-how, conocimiento y
experiencia, actuando en un plano táctico-estratégico de objetivos, proyectos y
formación.');
